import React from 'react'
import Link from 'next/link'
import { navbarLinks as link } from '../../NavigationMenu'


function Minnav(isOpen, toggle) {
    return (
        <div className={
            isOpen
                ? "bg-[#1d2128] text-center items-center"
                : "hidden"
        }
            onClick={toggle}
        >
            <div className=" h-40 text-white minnav">

                {link.map((nav) => {
                    const { id, text, path } = nav;
                    return (

                        <li as={`/${nav.path}`} href='/[pages]'>

                            <a>{text}</a>
                        </li>

                    )
                })}
            </div>

            <div className="h-6 bg-black md:hidden border-b-[1px]" style={{
                borderTopRightRadius: '30px',
                borderTopLeftRadius: '30px',
            }}
            >

            </div>
        </div>
    )
}

export default Minnav
